import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to appear (use class selector)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Find the first product card and click it to open the product detail modal
    const productCard = await page.$('.product-card');
    await productCard.click();

    // Wait for the product modal to appear (by id)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for modal to be visible (modal-content inside modal)
    await page.waitForSelector('#productModal .modal-content', { timeout: 5000 });

    // Take screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Extract product title from modal (using .product-detail-title)
    const productTitle = await page.$eval('#productModal .product-detail-title', el => el.textContent.trim());

    // Extract product price from modal (using .product-detail-price)
    const productPrice = await page.$eval('#productModal .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal by clicking a product card and verified modal content.",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
